import React from "react";
import logo from "./logo.svg";
import "./App.css";
import WrappedRegistrationForm from "./components/signup";
import MyCarousel from "./components/carousel";

function App() {
  return (
    <div className="Outer">
      <div className="Main">
        <MyCarousel />
        <div className="App">
          <WrappedRegistrationForm />
        </div>
      </div>
    </div>
  );
}

export default App;
